import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Time from './Time.js';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h1> Teja Venkat  </h1> 
            <Time></Time> 
            <div>#java #javascript  </div>     
        </header>
      </div>
    );
  }
}

export default App;
